import React from 'react';
import './pages.css'

const Home = () => {
    return (
        <div className='page'>
            <h2>
              Home page
            </h2>
            <h3>
                Welcome to feedback service!
            </h3>
            <text>
                This service in which users can submit various
                aspects of phenomena of objects for evaluation and can
                themselves evaluate objects already nominated by other users.
                Each object can be evaluated by different characteristics provided by the creator of the
                evaluated object. Additionally, the service can sort objects according
                to the ratings of other users.
            </text>
        </div>
    );
};

export default Home;
